import fmtEvent from './fmtEvent';
Component({
  data: {},
  properties: {
    className: {
      type: String,
      value: ''
    },
    styleSheet: {
      type: String,
      value: ''
    },
    numberOfLines: {
      type: Number,
      value: 0
    }
  },
  methods: {
    onClick: function (e) {
      var event = fmtEvent(this.props, e);
      this.props.onClick(event);
    }
  }
});